#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <math.h>

#include "fonctions.h"



void askName(char* name) // on demande une valeur
{
    int result;
    do
    {
        printf("\n> ");
        result=scanf("%s",name); // On récupère result qui permet de controler qu'on a bien entrer le bon type
        fflush(stdin); // On vide le buffer
    }while(result==0 || strlen(name)>MAXC);
}

int askValue() // on demande une valeur
{
    int result, value=0;
    do
    {
        printf("\n> ");
        result=scanf("%d",&value); // On récupère result qui permet de controler qu'on a bien entrer le bon type
        fflush(stdin); // On vide le buffer
    }while(result==0);
    return value;
}

void askSlot(trace** p, trace* t)
{
    int result, value=0;
    do
    {
        printf("\n> ");
        result=scanf("%d",&value); // On récupère result qui permet de controler qu'on a bien entrer le bon type
        fflush(stdin); // On vide le buffer
    }while(result==0 || value>10 || value<1);
    *p = &t[value-1];
}

int simuTrace(float tmax, float dt, param* p, trace* trace)
{
    if(p!=NULL && trace!=NULL)
    {
        int i=0, nb=trace->nbpts;
        printf("\n\nnb=%d ; name=%s",nb,trace->comment);

        if(trace->time!=NULL)
                free(&trace->time);
        if(trace->value!=NULL)
            free(&trace->value);

        trace->time = (float*)malloc(nb*sizeof(float));
        trace->value = (float*)malloc(nb*sizeof(float));

        float v=0,w=0, dv=0, dw=0, t=0;
        while (t<tmax)
        {
            dv=((p->a-v)*(v-1)*v)-w;
            dw=(p->e)*(((p->b)*v)-(p->l*w)-(p->s));
            v+=dv*dt;
            w+=dw*dt;
            trace->time[i]=t;
            trace->value[i]=v;
            i++;
            t+=dt;
        }
        return 0;
    }
    return -1;
}


int printTrace(trace* t)
{
    if(t!=NULL)
    {
        int i=0;
        printf("\n### Affichage de la trace ###\n");
        printf("%s",t->comment);
        for(i=0;i<(t->nbpts);i++)
            printf("\nt=%.1f\tv=%.4f",t->time[i],t->value[i]);
        return 0;
    }
    return -1;
}

