float errorTrace(trace* t1, trace* t2)
{
    if(t1!=NULL && t2!=NULL)
    {
        if(t1->nbpts==t2->nbpts)
        {
            float sum=0, result;
            int i;
            for(i=0;i<t1->nbpts;i++)
                 sum+=(float)pow(t1->value[i]-t2->value[i],2);
            result=(float)sqrt(sum/t1->nbpts);
            return result;
        }
    }
    return -1;
}


int saveTraceBin(char* fileTrace, trace* t)
{
    if(fileTrace!=NULL && t!=NULL)
    {
        FILE *fp;
        // open file for writing
        fp = fopen (fileTrace, "w");
        if (fp == NULL)
            return -1;

        // write struct to file
        int size=t->nbpts;
        fwrite(&size, sizeof(int), 1, fp);
        fwrite(t, sizeof(trace), 1, fp);
        fwrite(t->time, sizeof(t->time), 1, fp);
        fwrite(t->value, sizeof(t->value), 1, fp);

        // close file
        fclose (fp);

        return 0;
    }
    return -1;
}

int readTraceBin(char* fileTrace, trace* t)
{
    if(t!=NULL)
    {
        FILE *fp;

        // Open person.dat for reading
        fp = fopen (fileTrace, "r");
        if (fp == NULL)
            return -1;

        // read file contents till end of file
        int size;
        fread(&size, sizeof(int), 1, fp);
        if(t->time!=NULL)
            free(&t->time);
        if(t->value!=NULL)
            free(&t->value);
        fread(t, sizeof(trace), 1, fp);
        t->time = malloc(size*sizeof(float));
        t->value = malloc(size*sizeof(float));

        fread(t->time, size*sizeof(float), 1, fp);
        fread(t->value, size*sizeof(float), 1, fp);

        // close file
        fclose (fp);

        return 0;
    }
    return -1;
}


int saveTraceTxt(char* fileTrace, trace* t)
{
    if(fileTrace!=NULL && t!=NULL)
    {
        FILE *fp;
        int i;
        fp=fopen(fileTrace,"w");
        fprintf(fp,"%s\n%d\n",t->comment,t->nbpts);
        for (i=0;i<t->nbpts;i++)
        {
            fprintf(fp,"%.1f\t",t->time[i]);
            fprintf(fp,"%.4f\n",t->value[i]);
        }
        fclose(fp);
        return 0;
    }
    return -1;
}

int readTraceTxt(char* fileTrace, trace* t)
{
    if(t!=NULL)
    {
        FILE *fp;
        int i;
        if(fileTrace!= NULL && (fp=fopen(fileTrace,"r"))!=NULL)
        {
            fscanf(fp,"%s",t->comment);
            fscanf(fp,"%d",&t->nbpts);
            if(t->time!=NULL)
                free(&t->time);
            if(t->value!=NULL)
                free(&t->value);
            t->time = malloc(t->nbpts*sizeof(float));
            t->value = malloc(t->nbpts*sizeof(float));
            for (i=0;i<t->nbpts;i++)
                fscanf(fp,"%f%f",&t->time[i],&t->value[i]);
            fclose(fp);
            return 0;
        }
    }
    return -1;
}
